import React, { useState } from "react";
import { Link } from "react-router-dom";


function Login() {

    let[values,setValues] = useState({
        email:'',
        password:''
    })

    const handleSubmit = (event) => {
        event.preventDefault();
    }
  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-warning">
      <div className="bg-white p-3 rounded w-25">
        <form action="" onSubmit={handleSubmit}>
          <div className="mb-3">
            <label htmlFor="email">Email</label>
            <input type="text" placeholder="Enter email" className="form-control rounded-0"/>
          </div>
          <div className="mb-3">
            <label htmlFor="password">Password</label>
            <input type="password" placeholder="Enter password" className="form-control rounded-0"/>
          </div>
          <button type="submit" className="btn btn-success mb-3 w-100">Login</button>
          <p>Agree to our T&C</p>
          <Link to="/signup" className="btn btn-default border w-100">Creat Account</Link>
        </form>
      </div>
    </div>
  );
}

export default Login;
